import React, { useContext } from "react";
import UserContext from "./UserContext";

function Home() {
    const [user, setUser] = useContext(UserContext);
    if (user) {
        return (<>
            <h1>Home</h1>
            User is: { user }
            <button onClick={ () => setUser(null) }>Logout</button>
        </>);
    }
    return (<>
        <h1>Home</h1>
    </>);
}

export default Home;
